  true,\n\t\"url\": null,\n\t\"notes\": \"SVES is a batch query system utilizing the
  File Transfer Management System that provides States and some federal agencies with
  a standardized method of SSN verification and uniform data response for Title 2
  and/or Title 16 data. In addition to allowing States to receive SSN Verification,
  and if requested Title 2 and/or Title 16 data. SVES also allows states to request
  information from other SSA exchange systems external to SVES (e.g., BENDEX, SDX)
  via the SVES request.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
